function initialize2(){var e=document.getElementById("autocompleteid3"),t=new google.maps.places.Autocomplete(e,{types:["(regions)"],componentRestrictions:{country:['fr']}});t.addListener("place_changed",function(){var e=t.getPlace();console.log(e);document.getElementById("place_input3").setAttribute("value",e.formatted_address?.split(',')[1]),document.getElementById("place_input2").setAttribute("value",e.name),document.getElementById("searchButton").disabled=!1})}google.maps.event.addDomListener(window,"load",initialize2);